import React, { Component } from 'react';
import { Link } from "react-router-dom";

class Header extends Component {
    render() {
        return (
            <div>
                <nav className="navbar row">
                    <div className="container-fluid col">
                    <Link to="/"><h1 className="h1" style="color:white">Moviely</h1></Link>
                    </div>
                    <div className="col">
                    <Link to="/addmovie"><span className="btn btn-outline-secondary ">Add Movie</span></Link>
                    </div>
                    <div className="col">
                        <span>
                            <div class="input-group flex-nowrap">
                                <span class="btn btn-outline-secondary" id="addon-wrapping"> Items In Page </span>
                                <input type="number" class="form-control" placeholder="Items In Page"/>
                            </div>
                        </span>
                    </div>
                </nav>
            </div>
        );
    }
}

export default Header;
